 }
  }
}))
const useTable = (records, columns) => {
  const TblContainer = (props) => <Table>{props.children}</Table>;

  const TblHead = (props) => {
    return (
      <TableHead>
        <TableRow>
          {columns.map((item) => (
            <TableCell key={item.id}>{item.label}</TableCell>
          ))}
        </TableRow>
      </TableHead>
    );
  };
  return { TblContainer, TblHead };
};
export default useTable;
